from operator import itemgetter

from algs.strassen_matrix_multiply import MatrixMultiplication
from algs.time_algorithm import time_matrix_algorithm

text1 = '../txt_files/random_matrix_1.txt'
text2 = '../txt_files/random_matrix_2.txt'



def test_create_square_matrix_returns_a_matrix():
    sut = MatrixMultiplication()
    result = sut.create_square_matrix(3)
    assert (result) == [[0, 0, 0], [0, 0, 0], [0, 0, 0]]


def test_naive_matrix_multiply_multiplies_2x2_matrices():
    sut = MatrixMultiplication()
    matrix1 = [[1, 3], [2, 4]]
    matrix2 = [[4, 1], [3, 2]]
    result = sut.naive_matrix_multiply(2, matrix1, matrix2)
    assert result == [[13, 7], [20, 10]]


def test_naive_matrix_multiply_multiplies_3x3_matrices():
    sut = MatrixMultiplication()
    matrix1 = [[1, 3, 2], [3, 6, 8], [5, 2, 1]]
    matrix2 = [[6, 8, 6], [6, 3, 3], [2, 5, 1]]
    result = sut.naive_matrix_multiply(3, matrix1, matrix2)
    assert result == [[28, 27, 17], [70, 82, 44], [44, 51, 37]]


def test_recursive_matrix_multiply_multiplies_3x3_matrices():
    sut = MatrixMultiplication()
    matrix1 = [[1, 3, 2], [3, 6, 8], [5, 2, 1]]
    matrix2 = [[6, 8, 6], [6, 3, 3], [2, 5, 1]]
    result = sut.recursive_matrix_multiply(3, matrix1, matrix2)
    assert result == [[28, 27, 17], [70, 82, 44], [44, 51, 37]]


def test_strassen_matrix_multiply_multiplies_3x3_matrices():
    sut = MatrixMultiplication()
    matrix1 = [[1, 3, 2], [3, 6, 8], [5, 2, 1]]
    matrix2 = [[6, 8, 6], [6, 3, 3], [2, 5, 1]]
    result = sut.strassen_matrix_multiply(3, matrix1, matrix2)
    assert result == [[28, 27, 17], [70, 82, 44], [44, 51, 37]]


